import React from 'react';

function FooterList({linkData, title}) {
  return (

    <div> 
     <h3>{title}</h3>
      <nav>
      {
        linkData.map((link, index) =>  (
        <a key={index} href="#">{link.text}</a>
    ))}
      </nav>
      
    </div>

)  // return ender

}
export default FooterList;
